import React, {Component} from "react";
import "./Producto.css";

class Producto extends Component{
  render() {
    props=>{
      return(
      <div>
        <div className="col-md-4 producto">
          {props.producto.nombre}
        <button className="btn btn-primary">Comprar</button>
        </div>
      </div>
      );
    };
  }
}
export default Producto;
